import styled from '@emotion/styled';

const MapPage = () => {
  let ar = [10, 20, 30];
  let res = ar.map(() => {
    return 5;
  });
  console.log(res);

  let ar2 = [<h2>title</h2>, <h2>title2</h2>, <p>안녕하세요</p>];

  let todoList = [
    'java study',
    'html study',
    'css study',
    'team study',
    'k',
    'kkk',
    'kkkkk',
    'kkkkkkkk',
    'lkkkkkkkkkk',
  ];

  let list = todoList.map((element) => {
    return element - 1;
  });

  var postList = [
    {
      id: 5,
      title: 'cool',
      writer: 'sadf@sdaf.com',
      createdAt: '2023-08-08',
      updateedAt: '2023-09-15',
    },
  ];

  return (
    <>
      <h1>map function</h1>
      <h2> {res} </h2>
      <h2> {ar2} </h2>
      <h2> {list} </h2>
      <h1>글목록</h1>
      <WriteWrap>
        <WriteRow>
          <p>번호</p>
          <p>제목</p>
          <p>글쓴이</p>
          <p>작성일</p>
          <p>수정일</p>
        </WriteRow>
        <WriteRow>
          <p>1번</p>
          <p>ㅁㅇㄴㄹ</p>
          <p>asd</p>
          <p>2017-01-01</p>
          <p>017-09-11</p>
        </WriteRow>
        <WriteRow>
          <p>2번</p>
          <p>ㅇㄴㄹㄴㅁㄹㅇ</p>
          <p>k</p>
          <p>2017-09-18</p>
          <p>2017-12-01</p>
        </WriteRow>
      </WriteWrap>
    </>
  );
};

const WriteWrap = styled.div`
  background-color: skyblue;
  border-radius: 20px;
  box-shadow: pink;
  width: 80%;
  margin: 0 auto;
  padding: 10px;
`;

const WriteRow = styled.div`
  display: flex;
  & p {
    text-align: center;
    flex-grow: 1;
  }
  & p:nth-child(1) {
    width: 10%;
  }
`;

export default MapPage;
